import React from "react";
import "../styles/global.css";

const Projects = () => {
  return (
    <div className="projects">
      <h1>Projects</h1>
      <div className="project-list">
        <div className="project-item">Project 1</div>
        <div className="project-item">Project 2</div>
      </div>
    </div>
  );
};

export default Projects;
